import './App.css';

//component is a piece of code that returns or renders JSX
const Person = (props) => {
  return (
    <>
    <h1> Name: {props.name}</h1>
    <h2>Last Name: {props.lastName}</h2>
    <h2> Age: {props.age}</h2>
    </>
  )
}

//props allow you to pass dynamic data through react components
//props are just arguments that you pass into react components 
//props are passed via attributes 
//props = shortened way of saying properties

//pass name={'John'} into Person react component below 
//every component has a built in props object 

const App = () => {
  return (
    <div className="App">
      <Person name={'John'} lastName={'Doe'} age={25}/> 
      <Person name ="Jane" age={2+2}/> 
      <Person /> 
      <Person /> 
      <Person /> 
    </div>
  )
}


export default App;
